import React from 'react';
import { ImageCardGroupContainer, Title} from './styles'; //, VideoCardList
import ImageCard from './ImageCard/index';
import Slider, { SliderItem } from './Slider/index';

function VideoCardGroup(props){


    return (
        <ImageCardGroupContainer>

      <Slider>

            <SliderItem key={props.titulo}>
              <ImageCard
                imageTitle={props.titulo}
                imageURL={props.url}
                />
            </SliderItem>
      </Slider>
    </ImageCardGroupContainer>
    );

};


    export default VideoCardGroup;
